import { getAll } from "../../utils/auth";
const initialState = {
  userInfor: {},
};
const LoginReducer = (state = initialState, action) => {
  switch (action.type) {
    case "LOGIN_INFO":
      console.log("all--", getAll());
      return {
        userInfor: getAll(),
      };

    default:
      return state;
  }
};

export default LoginReducer;
